        <meta name="viewport" content="width=device-width, initial-scale=1"> 
        <script>H5PIntegration = {"ajax":{"setFinished":"","contentUserData":""},"ajaxPath":"/h5p/ajax?action=","contents":{"cid-3197685918":{"displayOptions":{"copy":false,"copyright":true,"embed":false,"export":false,"frame":true,"icon":false},"fullScreen":"1","jsonContent":"{\"iconType\":\"icon\",\"icon\":\"plus\",\"color\":\"#981d99\",\"hotspots\":[{\"position\":{\"x\":5.6000000000000005,\"y\":13.08940555529664},\"alwaysFullscreen\":false,\"content\":[{\"library\":\"H5P.Text 1.1\",\"params\":{\"text\":\"<p>The method of separating heavier and lighter components of a mixture by wind or by blowing air is called<strong> winnowing</strong>.The mixture is tossed into the air, wind blows away the lighter husk while heavier grains fall back.</p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"81916fbe-207a-4fac-9260-964dce115ed4\"}]},{\"position\":{\"x\":58.8,\"y\":48.9532844759286},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p><strong>Sieving </strong>is a separation technique that uses a mesh or sieve to separate particles based on size. Larger particles are retained on the sieve, while smaller ones pass through it.</p>\\n\\n<p>Example: Flour is sieved to remove bran or impurities before cooking chapati,separating fine sand from gravel.<br />\\n </p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"2b2caf4e-0575-4606-bbcb-b44f4bae0023\"},{\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]},\"subContentId\":\"1d40e144-28bc-4a14-8faf-591958725b52\"},{\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]},\"subContentId\":\"b93f51fd-1970-4951-93cf-c2ec8ba2aa47\"}]},{\"position\":{\"x\":62,\"y\":18.31424476860698},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>The process of separating grains from stalks is called<strong> threshing</strong>.  Here stalks are beaten or mechanically threshed to loosen grains.This method is used in farming, especially for crops like wheat and rice.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"fd7a7eec-0f60-43e0-b8cd-dd2878ce240a\"}]},{\"position\":{\"x\":8.4,\"y\":48.352518991471314},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>The method of removing visible impurities (such as stones and husk from wheat and rice) by hand from a mixture is called<strong> hand picking</strong>. It is used in household kitchens, small-scale sorting.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"5ec6ad0c-d7bc-4150-81b1-27011e044f2c\"}]},{\"position\":{\"x\":8.799999999999999,\"y\":81.30359556321946},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p><strong>SEDIMENTATION</strong> : The process of settling down of heavier insoluble component at the bottom of the liquid is called <strong>sedimentation</strong>. Here the mixture is left undisturbed; solids settle at the bottom due to gravity. It is used in Water purification, muddy water separation.</p>\\n\\n<p> </p>\\n\\n<p><strong>DECANTATION</strong> : . After sedimentation, the clear liquid is gently poured of, this process is called <strong>decantation.</strong> It is used in separating oil from water, or water from mud.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"5133d0f6-58d8-4002-9555-b8a3b9f849f4\"}]},{\"position\":{\"x\":59.199999999999996,\"y\":76.62490679032483},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>The process of separating insoluble solids from liquids is called <strong>filtration</strong>.Here the mixture is passed through filter paper, solids stay on filter paper and  liquid passes through it . this method  is used to seperate lab mixtures, in kitchen, water treatment.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"793bc809-26df-46bc-b718-802fca4f0ad7\"}]}],\"hotspotNumberLabel\":\"Hotspot #num\",\"closeButtonLabel\":\"Close\",\"containsAudioVideoLabel\":\"Contains Audio/Video\",\"image\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAABgAAAAQACAIAAACoEwUVAAA5kWNhQlgAADmRanVtYgAAAB5qdW1kYzJwYQARABCAAACqADibcQNjMnBhAAAAOWtqdW1iAAAAR2p1bWRjMm1hABEAEIAAAKoAOJtxA3Vybjp1dWlkOjIyYTRlMmRmLWI4NDktNDZiYi1iYTU3LWRkNTIwZjVkZjQ2MgAAAAqcanVtYgAAAClqdW1kYzJhcwARABCAAACqADibcQNjMnBhLmFzc2VydGlvbnMAAAAJZmp1bWIAAABBanVtZGNib3IAEQAQgAAAqgA4m3ETYzJwYS5oYXNoLmJveGVzAAAAABhjMnNoWRCVka0XKuAtFQY/+ZCTWwAACR1jYm9yomNhbGdmc2hhMjU2ZWJveGVzmCmjZW5hbWVzgWRQTkdoZGhhc2hYIExLajvhMUq4YTi+9DFN3gIuYAlg2GiaLI+GMYAtINq2Y3BhZECjZW5hbWVzgWRJSERSZGhhc2hYIHHpKrVQG0rEwOhKprjmCOqcKhhyFRbIGadjio2Qgu3vY3BhZECjZW5hbWVzgWRDMlBBZGhhc2hBAGNwYWRAo2VuYW1lc4FkSURBVGRoYXNoWCD0O+MfbiwDD7Bd7U1WdPwDGoPAGi77V4lVCAjZodUxA2NwYWRAo2VuYW1lc4FkSURBVGRoYXNoWCDXkZF2sZxutIuX5X0HfAuJNdfGe2pmti0m5HULnnuK5WNwYWRAo2VuYW1lc4FkSURBVGRoYXNoWCCp7AZAL1yg2ctm7uVQO/57wfMUhbtriFTTGUk2H7WkVmNwYWRAo2VuYW1lc4FkSURBVGRoYXNoWCCXWRi6fRQnbb3UEK754OFJs5CfKRwUG81Hs9WeUgg132NwYWRAo2VuYW1lc4FkSURBVGRoYXNoWCATKa8WH00CazJez9Kf/cce7T48pj9
